import React from 'react';
import icone from '../../styles/images/icone.png';
import 'primereact/resources/themes/saga-blue/theme.css';
import 'primereact/resources/primereact.min.css';
import '../../styles/css/layout.css';
import { BiLogOutCircle } from 'react-icons/bi/index';
import { Typography } from 'antd';

const { Text } = Typography

const style = {
    main: {
        height: '100%',
        width: '100%',
        background: '#fff',
        display: 'flex',
        flexDirection: 'column'
    },
    navbar: {
        height: '7%',
        width: '100%',
        display: 'flex',
        background: 'linear-gradient(90deg, rgb(255, 119, 59) 0%, rgb(255, 142, 36) 35%, rgb(255, 84, 67) 100%)',
        alignItems: 'center',
        justifyContent: 'space-between',
        maxHeight: '53px',
        minHeight: '53px'
    }
}

const Layout = (props) => {
    return (
        <main style={style.main}>
            <div style={style.navbar}>
                <div style={{ marginLeft: '10px', marginTop: '7px' }}>
                    <img style={{ width: '46px' }} src={icone} alt="CNX Telecom - você sempre conectado!" />
                </div>
                <div style={{ marginRight: '10px' }}>
                    <Text className='textAnim' style={{ color: '#fff' }} strong >usuário</Text><br />
                    <BiLogOutCircle style={{ fontSize: '25px', cursor: 'pointer' }} />
                </div>
            </div>
            <div>

            </div>
        </main>
    )
}

export default Layout;
